import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Tenders = () => {
  const [state, setState] = useState('');
  const [district, setDistrict] = useState('');
  const [department, setDepartment] = useState('');
  const [showExpired, setShowExpired] = useState(false);
  const [tenders, setTenders] = useState([]);
  const [states, setStates] = useState([]);
  const [districts, setDistricts] = useState([]);
  const [departments, setDepartments] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const statesResponse = await axios.get('/api/states');
        setStates(statesResponse.data);

        const districtsResponse = await axios.get('/api/districts');
        setDistricts(districtsResponse.data);

        const departmentsResponse = await axios.get('/api/departments');
        setDepartments(departmentsResponse.data);
      } catch (error) {
        console.error('Error fetching options', error);
      }
    };

    fetchData();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('/api/tenders', {
        state,
        district,
        department,
        showExpired,
      });
      setTenders(response.data);
    } catch (error) {
      console.error('Error fetching tenders', error);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div>
          <label>State:</label>
          <select value={state} onChange={(e) => setState(e.target.value)} required>
            <option value="">Select State</option>
            {states.map((state) => (
              <option key={state} value={state}>
                {state}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>District:</label>
          <select value={district} onChange={(e) => setDistrict(e.target.value)} required>
            <option value="">Select District</option>
            {districts.map((district) => (
              <option key={district} value={district}>
                {district}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>Department:</label>
          <select value={department} onChange={(e) => setDepartment(e.target.value)} required>
            <option value="">Select Department</option>
            {departments.map((department) => (
              <option key={department} value={department}>
                {department}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>
            <input
              type="checkbox"
              checked={showExpired}
              onChange={(e) => setShowExpired(e.target.checked)}
            />
            Show Expired Tenders
          </label>
        </div>
        <button type="submit">Search</button>
      </form>

      <div>
        {tenders.length > 0 ? (
          <ul>
            {tenders.map((tender) => (
              <li key={tender.tender_id}>
                <h3>{tender.title}</h3>
                <p>{tender.org_name}</p>
                <p>{tender.district}, {tender.state}</p>
                <p>{tender.expired ? 'Expired' : 'Active'}</p>
              </li>
            ))}
          </ul>
        ) : (
          <p>No tenders found</p>
        )}
      </div>
    </div>
  );
};

export default Tenders;
